You can't do this: # struct BirthdayCard;
impl BirthdayCard { fn new(name: &str) -> BirthdayCard {
# Self // ... } // Can't add more overloads: // // fn new(name: &str, age: i32) -> BirthdayCard { // ... // } // // fn new(name: &str, text: &str) -> BirthdayCard { // ... // }
} Instead, use the builder pattern . In place of overloaded constructors, add methods which take &mut self and return &mut Self: # struct BirthdayCard;
impl BirthdayCard { fn new(name: &str) -> BirthdayCard {
# Self // ... } fn age(&mut self, age: i32) -> &mut BirthdayCard {
# self // ... } fn text(&mut self, text: &str) -> &mut BirthdayCard {
# self // ... }
} You can then chain these into short or long constructions, passing parameters as necessary: # struct BirthdayCard;
# impl BirthdayCard {
# fn new(name: &str) -> BirthdayCard {
# Self
# // ...
# }
#
# fn age(&mut self, age: i32) -> &mut BirthdayCard {
# self
# // ...
# }
#
# fn text(&mut self, text: &str) -> &mut BirthdayCard {
# self
# // ...
# }
# }
# fn main() {
let card = BirthdayCard::new("Paul").age(64).text("Happy Valentine's Day!");
# } Note another advantage of builders: Overloaded constructors often don't provide all possible combinations of parameters, whereas with the builder pattern, you can combine exactly the parameters you want.

