You're going to have to do something with interior mutability : either RefCell<T> or its multithreaded equivalent, RwLock<T>. You have three decisions to make: Will only Rust code access this particular instance of this object, or might C++ access it too? If both C++ and Rust may access the object, how do you avoid conflicts? How should Rust code react if the object is not available, because something else is using it? If only Rust code can use this particular instance of shared state, then simply wrap it in RefCell<T> (single-threaded) or RwLock<T> (multi-threaded). Build a wrapper type such that callers aren't able to access the object directly, but instead only via the lock type. If C++ also needs to access this particular instance of the shared state, it's more complex. There are presumably some invariants regarding use of this data in C++ - otherwise it would crash all the time. Perhaps the data can be used only from one thread, or perhaps it can only be used with a given mutex held. Your goal is to translate those invariants into an idiomatic Rust API that can be checked (ideally) at compile-time, and (failing that) at runtime. For example, imagine: class SharedMutableGoat {
public: void eat_grass(); // mutates tummy state
}; std::mutex lock;
SharedMutableGoat* billy; // only access when owning lock Your idiomatic Rust wrapper might be: # mod ffi {
# #[allow(non_camel_case_types)]
# pub struct lock_guard;
# pub fn claim_lock() -> lock_guard { lock_guard{} }
# pub fn eat_grass() {}
# pub fn release_lock(lock: &mut lock_guard) {}
# }
struct SharedMutableGoatLock { lock: ffi::lock_guard, // owns a std::lock_guard<std::mutex> somehow
}; // Claims the lock, returns a new SharedMutableGoatLock
fn lock_shared_mutable_goat() -> SharedMutableGoatLock { SharedMutableGoatLock { lock: ffi::claim_lock() }
} impl SharedMutableGoatLock { fn eat_grass(&mut self) { ffi::eat_grass(); // Acts on the global goat }
} impl Drop for SharedMutableGoatLock { fn drop(&mut self) { ffi::release_lock(&mut self.lock); }
} Obviously, lots of permutations are possible, but the goal is to ensure that it's simply compile-time impossible to act on the global state unless appropriate preconditions are met. The final decision is how to react if the object is not available. This decision can apply with C++ mutexes or with Rust locks (for example RwLock<T>). As in C++, the two major options are: Block until the object becomes available. Try to lock, and if the object is not available, do something else. There can be a third option if you're using async Rust. If the data isn't available, you may be able to return to your event loop using an async version of the lock ( Tokio example , async_std example ).

