Which of these is best? fn a(params: &[String]) { // ...
} fn b(params: &[&str]) { // ...
} fn c(params: &[impl AsRef<str>]) { // ...
} (You'll need to make an equivalent decision in other cases, e.g. Path versus PathBuf versus AsRef<Path>.) None of the options is clearly superior; for each option, there's a case it can't handle that the others can: # fn a(params: &[String]) {
# }
# fn b(params: &[&str]) {
# }
# fn c(params: &[impl AsRef<str>]) {
# }
fn main() { a(&[]); // a(&["hi"]); // doesn't work a(&vec![format!("hello")]); b(&[]); b(&["hi"]); // b(&vec![format!("hello")]); // doesn't work // c(&[]); // doesn't work c(&["hi"]); c(&vec![format!("hello")]);
} So you have a variety of interesting ways to slightly annoy your callers under different circumstances. Which is best? AsRef has some advantages: if a caller has a Vec<String>, they can use that directly, which would be impossible with the other options. But if they want to pass an empty list, they'll have to explicitly specify the type (for instance &Vec::<String>::new()). Not a huge fan of AsRef everywhere - it's just saving the caller typing. If you have lots of AsRef then nothing is object-safe. - MG TL;DR: choose the middle option, &[&str]. If your caller happens to have a vector of String, it's relatively little work to get a slice of &str: # fn b(params: &[&str]) {
# } fn main() { // Instead of b(&vec![format!("hello")]); let hellos = vec![format!("hello")]; b(&hellos.iter().map(String::as_str).collect::<Vec<_>>());
}
